// 홈 페이지
import MealPage from './MealPage';
import {useSelector} from 'react-redux';

const MainPage = () => {
    const {value} = useSelector(state => ({
        value: state.SelectMenu.value,
    }));
    
    return(
        <div>
            <MealPage />
        </div>
    )
}

export default MainPage;
